$(document).ready(function(){
    var image_width = $('.eighth_video_image--blocks .homepage-image_wrap img').width();
    $('.eighth_video_image--blocks .video-with--text iframe').css('width',image_width);
    var image_width6 = $('.sixth_video_image--blocks .homepage-image_wrap img').width();
    $('.sixth_video_image--blocks .video-with--text iframe').css('width',image_width6);
    var image_width4 = $('.four_video_image--blocks .homepage-image_wrap img').width();
    $('.four_video_image--blocks .video-with--text iframe').css('width',image_width4);
    $('.video-with--text').click(function(ev){
      $(this).hide();
      $(this).siblings().find('iframe')[0].src += "?autoplay=1";
      ev.preventDefault();
    })
    var img_height = $('img.product-single__photo').height();
    //     console.log(img_height);
    $('.thumb').click(function(){
      var url=$(this).find('img').attr('alt')
      if(url.indexOf("http") > -1) {
        $('.product-video iframe').attr('src',$(this).find('img').attr('alt'));
        $('.product-video').removeClass('custom-hide');
        $('.custom-featured-img').addClass('custom-hide');
        $('.product-video iframe').css('height',img_height);
      }
      else
      {
        $('.product-video').addClass('custom-hide');
        $('.custom-featured-img').removeClass('custom-hide');
        $('.product-video iframe').attr('src','');
      }
    })

    $('.accordion_wrapper .accordion').last().addClass('last-accordian');
    $('.accordion_wrapper .panel').last().addClass('last-panel');
    //     $('.accordion_wrapper .accordion').click(function(){
    //       $('.accordion').removeClass('active');
    //       $('.panel').slideUp();
    //       $(this).toggleClass('active');
    //       $(this).next().slideToggle();
    //     })
    //     $("#accordion_wrapper > div").click(function() {
    //       $('.accordion').removeClass('active');
    //       $('.panel').hide();
    //       $(this).toggleClass("active").next('p').slideToggle(250)
    //       .closest('div').siblings().removeClass('active').next('p').slideUp(250);
    //     });
    var acc = document.getElementsByClassName("accordion");
    var i;

    for (i = 0; i < acc.length; i++) {
      acc[i].addEventListener("click", function() {

        this.classList.toggle("active");
        var panel = this.nextElementSibling;
        if (panel.style.display === "block") {
          panel.style.display = "none";
        } else {
          panel.style.display = "block";
        }
        //         $('.accordion').removeClass('active');
        //         $('.panel').hide();
      });
    }
  })